.container {
background: rgba(0, 0, 0, 0.5);
padding: 50px;
border-radius: 10px;
}

h1 {
font-size: 3em;
margin-bottom: 20px;
animation: fadeIn 2s ease-in;
}

p {
font-size: 1.5em;
margin-bottom: 40px;
animation: fadeIn 3s ease-in;
}

.button {
background-color: #ff69b4;
color: white;
padding: 15px 30px;
text-decoration: none;
font-size: 1.2em;
border-radius: 5px;
transition: background-color 0.3s ease;
animation: fadeIn 4s ease-in;
}

.button:hover {
background-color: #ff1493;
}

@keyframes fadeIn {
from {
opacity: 0;
}
to {
opacity: 1;
}
}
</style>
